import React from 'react';

export class Terms extends React.Component{

    render(){
        return (
            <article id="notification">
                <h1>About Richard</h1>
                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nunc tristique rutrum ipsum quis elementum. Donec sit amet tempus dui. Fusce posuere magna accumsan aliquam tempor. Morbi scelerisque libero sit amet lacus rhoncus, at volutpat est convallis. Duis condimentum vitae purus faucibus mollis. Pellentesque justo eros, ornare ut justo ac, finibus aliquam magna. Praesent ac tortor tempus, lacinia metus ac, rhoncus felis. Nullam aliquam euismod turpis. Vivamus congue nulla mauris, in congue mi malesuada sit amet. Mauris vel lorem euismod, suscipit libero ac, bibendum dui. Phasellus faucibus diam nec commodo sollicitudin. Integer in mauris vitae erat venenatis rutrum ut eu est. Quisque euismod eros urna, ac feugiat neque laoreet at. Sed lacinia commodo odio vel tempus.

Fusce pellentesque in turpis quis venenatis. Aliquam sodales cursus ante, ut convallis orci fermentum non. Pellentesque a mauris nec ligula cursus pulvinar at at libero. Praesent libero dui, viverra ac venenatis ac, gravida sed nunc. Maecenas eleifend dapibus semper. Nunc lacinia lorem at ex hendrerit blandit. Suspendisse varius tellus erat, nec maximus metus fringilla ut. Pellentesque consequat aliquet mollis. Praesent cursus quis lectus sit amet convallis. Suspendisse eu nisi est. Praesent in arcu purus. Aliquam vel imperdiet enim. Suspendisse molestie diam lectus, ut sodales ante porttitor vel. Praesent sit amet neque porta, blandit urna eu, egestas tellus. Fusce dapibus molestie eros vel ultrices. Aliquam erat volutpat.

Proin erat ipsum, vulputate at dapibus consequat, molestie eu nisl. Aliquam mollis velit nunc. Aenean imperdiet vestibulum gravida. Nullam blandit leo magna. Aliquam dictum ultricies justo, vel rhoncus mi congue non. Integer id lacus ut est efficitur molestie quis at felis. Suspendisse pharetra mauris quis augue elementum tristique. Vestibulum quis diam a nulla fringilla maximus. Aenean et dolor nec erat varius sagittis. Sed ornare tortor id iaculis lacinia. Ut pharetra quam nec metus convallis facilisis. In accumsan ullamcorper dolor condimentum ultricies.

Suspendisse mollis dui ac massa bibendum rhoncus. Fusce ut euismod lorem. Praesent hendrerit justo in lectus tempus efficitur. Morbi gravida est non ornare efficitur. Vestibulum congue vel neque quis pulvinar. Donec id dictum mi, a condimentum justo. Vestibulum et ipsum posuere dui pulvinar placerat quis et tortor. Pellentesque pharetra bibendum nisl, in posuere diam. Vestibulum id purus sed dui imperdiet egestas sed quis nisi.

Donec luctus ullamcorper luctus. Integer sem purus, lobortis sit amet nisl eget, molestie congue sem. In varius, eros vitae congue fermentum, velit urna rutrum mi, vitae sagittis turpis augue a felis. Morbi ultricies nisi lacus, vel ullamcorper libero viverra vel. Phasellus ultricies consectetur ligula, eget aliquam turpis molestie eu. Integer volutpat in erat et ultrices. Ut dapibus blandit velit vel faucibus. Duis euismod ex nec diam semper, id molestie ante egestas. Vestibulum finibus, nunc vitae congue lobortis, mauris mauris pulvinar odio, rutrum tempor magna libero ut mauris. In vel convallis nulla. </p>
            </article>    
        )
    }

}
